import { Box } from "@mui/material";
import React from "react";
import { appColor } from "../../../assets/Color";

const Sidebar = () => {
  return (
    <Box
      sx={{
        width: "300px",
        height: "100vh",
        position: "sticky",
        background: `linear-gradient(to bottom, #ffffff, ${appColor.yellow})`,
      }}
    >
      Sidebar
    </Box>
  );
};

export default Sidebar;
